using EAU.Security;
using Microsoft.Extensions.Configuration;
using Microsoft.Extensions.Logging;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Security.Claims;
using System.Security.Cryptography.X509Certificates;
using System.Text.RegularExpressions;

namespace EAU.Web.IdentityServer.Common
{
    public interface IEAUClaimsHelper
    {
        bool TryBuildPersonIdentifierTypeClaim(X509Certificate2 clientCertificate, out Claim claim);
        bool TryBuildPersonIdentifierTypeClaim(string sourceValue, out Claim claim);
        bool TryBuildClaim(X509Certificate2 clientCertificate, string claimType, out Claim claim);
        bool TryBuildClaim(string sourceValue, string claimType, out Claim claim);
    }

    public class EAUClaimsHelper : IEAUClaimsHelper
    {
        private readonly IConfiguration _eauConfiguration;
        private readonly ILogger _logger;

        public EAUClaimsHelper(IConfiguration configuration, ILogger<EAUClaimsHelper> logger)
        {
            _eauConfiguration = configuration.GetEAUSection();
            _logger = logger;
        }

        public bool TryBuildPersonIdentifierTypeClaim(X509Certificate2 clientCertificate, out Claim claim)
        {
            string subjectData = clientCertificate.GetType().GetProperty("Subject").GetValue(clientCertificate).ToString();

            return TryBuildPersonIdentifierTypeClaim(subjectData, out claim);
        }

        public bool TryBuildPersonIdentifierTypeClaim(string sourceValue, out Claim claim)
        {
            claim = default;

            if (string.IsNullOrEmpty(sourceValue))
                return false;
            else
            {
                var personIdentifier = GetProperty(sourceValue, EAUClaimTypes.PersonIdentifier);

                if (string.IsNullOrEmpty(personIdentifier)) return false;

                claim = new Claim(EAUClaimTypes.PersonIdentifierType, DeterminePersonIdentifierType(personIdentifier));

                _logger.LogDebug($"Parsed claim from certificate: {claim.Type} - {claim.Value}");

                return true;
            }
        }

        public bool TryBuildClaim(X509Certificate2 clientCertificate, string claimType, out Claim claim)
        {
            claim = default;

            string subjectData = clientCertificate.GetType().GetProperty("Subject").GetValue(clientCertificate).ToString();

            if (string.IsNullOrWhiteSpace(subjectData))
                return false;
            else
            {
                var claimValue = GetProperty(subjectData, claimType);

                if (string.IsNullOrEmpty(claimValue)) return false;

                claim = new Claim(claimType, claimValue);

                _logger.LogDebug($"Parsed claim from certificate: {claim.Type} - {claim.Value}");

                return true;
            }
        }

        public bool TryBuildClaim(string sourceValue, string claimType, out Claim claim)
        {
            claim = default;

            if (string.IsNullOrWhiteSpace(sourceValue))
                return false;
            else
            {
                var claimValue = GetProperty(sourceValue, claimType);

                if (string.IsNullOrEmpty(claimValue)) return false;

                claim = new Claim(claimType, claimValue);

                _logger.LogDebug($"Parsed claim from certificate: {claim.Type} - {claim.Value}");

                return true;
            }
        }

        #region Helpers

        private string GetProperty(string data, string propertyName)
        {
            string propertyPattern = null;

            switch (propertyName)
            {
                case EAUClaimTypes.PersonIdentifier:
                    propertyPattern = _eauConfiguration.GetValue<string>("GL_CERT_SUBJ_PERSONIDENT_PATTERN");    //propertyPattern = @"PNOBG-(?<value>\d{10}).*";                 
                    break;
                case EAUClaimTypes.UIC:
                    propertyPattern = _eauConfiguration.GetValue<string>("GL_CERT_SUBJ_UIC_PATTERN");  //@"NTRBG-(?<value>\d{9}).*";
                    break;
                case EAUClaimTypes.PersonNames:
                    propertyPattern = _eauConfiguration.GetValue<string>("GL_CERT_SUBJ_PERSONNAMES_PATTERN"); //@"CN\s*=\s*(?<value>[A-Za-zА-Яа-я0-9\s.,]*).*";
                    break;
            }

            Regex r = new Regex(propertyPattern, RegexOptions.IgnoreCase);
            Match m = r.Match(data);

            if (m.Success)
            {
                Group g = m.Groups["value"];
                return g.Value;
            }
            if (propertyName == EAUClaimTypes.PersonIdentifier)
            {
                propertyPattern = _eauConfiguration.GetValue<string>("GL_CERT_SUBJ_PERSONLNCH_PATTERN"); //@"PI:BG-(?<value>\d+).";

                r = new Regex(propertyPattern, RegexOptions.IgnoreCase);
                m = r.Match(data);

                if (m.Success)
                {
                    Group g = m.Groups["value"];
                    return g.Value;
                }
            }

            return null;
        }

        private static string DeterminePersonIdentifierType(string personIdentifier)
        {
            if (string.IsNullOrEmpty(personIdentifier))
            {
                return null;
            }

            if (ValidateEGN(personIdentifier) && !LNChs().Contains(personIdentifier))
                return "egn";

            if (ValidateLNCH(personIdentifier) || LNChs().Contains(personIdentifier))
                return "lnch";

            return "other";
        }

