        private static bool ValidateEGN(string egn)
        {
            int[] array = null;
            if (ValidateDigits(egn))
            {
                array = (from d in egn.ToCharArray()
                         select Convert.ToInt32(d.ToString())).ToArray();
                return ValidateEGN(array);
            }

            return false;
        }

        private static bool ValidateEGN(int[] digits)
        {
            int[] array = new int[9]
            {
                2,
                4,
                8,
                5,
                10,
                9,
                7,
                3,
                6
            };
            int[] array2 = new int[12]
            {
                31,
                28,
                31,
                30,
                31,
                30,
                31,
                31,
                30,
                31,
                30,
                31
            };
            if (digits.Count() != 10)
            {
                return false;
            }

            if (!ValidateBirthDatePr(digits))
            {
                return false;
            }

            int num = 0;
            for (int i = 0; i < array.Length; i++)
            {
                num += digits[i] * array[i];
            }

            num %= 11;
            if (10 == num)
            {
                num = 0;
            }

            if (digits[9] != num)
            {
                return false;
            }

            return true;
        }

