        private static bool ValidateLNCH(int[] digits)
        {
            if (digits.Count() != 10)
            {
                return false;
            }

            int[] array = new int[9]
            {
                21,
                19,
                17,
                13,
                11,
                9,
                7,
                3,
                1
            };
            int num = 0;
            for (int i = 0; i < array.Length; i++)
            {
                num += digits[i] * array[i];
            }

            num %= 10;
            if (num == 10)
            {
                num = 0;
            }

            if (num != digits[9])
            {
                return false;
            }

            return true;
        }

        private static bool ValidateDigits(string text)
        {
            if (!string.IsNullOrEmpty(text))
            {
                char[] array = text.ToCharArray();
                foreach (char c in array)
                {
                    if (!char.IsDigit(c))
                    {
                        return false;
                    }
                }

                return true;
            }

            return false;
        }

        private static bool ValidateBirthDatePr(int[] digits)
        {
            int[] array = new int[12]
            {
                31,
                28,
                31,
                30,
                31,
                30,
                31,
                31,
                30,
                31,
                30,
                31
            };
            int num = digits[4] * 10 + digits[5];
            int num2 = digits[2] * 10 + digits[3];
            int num3 = digits[0] * 10 + digits[1];
            int num4 = 0;
            if (num2 >= 1 && num2 <= 12)
            {
                num4 = 1900 + num3;
            }
            else if (num2 >= 21 && num2 <= 32)
            {
                num2 -= 20;
                num4 = 1800 + num3;
            }
            else
            {
                if (num2 < 41 || num2 > 52)
                {
                    return false;
                }

                num2 -= 40;
                num4 = 2000 + num3;
            }

            array[1] += (DateTime.IsLeapYear(num4) ? 1 : 0);
            if (num < 1 || num > array[num2 - 1])
            {
                return false;
            }

            return true;
        }

